import { defineConfig } from "@playwright/test";

export default defineConfig({
  testDir: ".",
  testMatch: ["**/*.spec.ts"],
  testIgnore: ["**/node_modules/**"],
  fullyParallel: true,
  forbidOnly: !!process.env.CI,
  retries: process.env.CI ? 2 : 0,
  reporter: [ // https://playwright.dev/docs/test-reporters
    [
      "monocart-reporter",
      {
        name: "URL Redirector E2E Coverage Report",
        outputFile: "test/coverage/index.html",
        open: true,
        logging: "warn", // "debug", "info", "warn", "error"
        coverage: {
          lcov: true,
          reports: [
            ['v8'],              // generates JSON format files
            ['html'],             // generates HTML report files
            ['console-details'], // shows CLI table with summary
          ],
          entryFilter: (entry: any) => {
            // Only accept files that are part of YOUR project
            if (entry.url.includes('node_modules')) return false;
            // Only include files that are likely your source code
            const isProjectFile = entry.url.includes('/dist/') || entry.url.includes('/src/')
            // Exclude CSS files
            return isProjectFile && !entry.url.endsWith('.css');
          },
          // Keep source filter to ensure we map back to TS files if possible
          sourceFilter: (sourcePath: string) => sourcePath.search(/src\//) !== -1,
        },
      },
    ],
    ["list"], // compact
    ["html", { outputFolder: "test/playwright-report", open: true }], // artifacts
  ],
  outputDir: "test/test-results",
  use: {
    trace: "retain-on-failure",
    video: "retain-on-failure",
    screenshot: "only-on-failure",
    launchOptions: {
      // slowMo: 100, // Optionally slow down the test execution in the browser. Use with workers: 1 to watch the test execution.
    },
  },
  // workers: 1, // Use 1 worker to run tests serially and watch the test execution.
});

import { test, expect } from './coverage-fixture';
import { loadGcpSecrets } from '../../scripts/load-dotenv-from-gcp';

test.describe('Load GCP Secrets Script', () => {
    let mockSecretManagerServiceClient: any;
    let mockLog: any;
    let mockError: any;
    let mockExit: any;
    let logs: string[] = [];
    let errors: string[] = [];
    let exitCode: number | undefined;

    test.beforeEach(() => {
        logs = [];
        errors = [];
        exitCode = undefined;

        mockLog = (...args: any[]) => logs.push(args.join(' '));
        mockError = (...args: any[]) => errors.push(args.join(' '));
        mockExit = (code: number) => { exitCode = code; };

        mockSecretManagerServiceClient = class {
            async accessSecretVersion(request: any) {
                if (request.name.includes('latest')) {
                    return [{
                        payload: {
                            data: Buffer.from('KEY=VALUE\nANOTHER=ONE')
                        }
                    }];
                }
                throw new Error('Secret not found');
            }
        };
    });

    test('should load secrets correctly', async () => {
        const envConfig = await loadGcpSecrets('test-project', 'test-secret', {
            deps: {
                SecretManagerServiceClient: mockSecretManagerServiceClient,
                log: mockLog,
                error: mockError,
                exit: mockExit
            }
        });

        expect(envConfig).toBeDefined();
        expect(envConfig!['KEY']).toBe('VALUE');
        expect(envConfig!['ANOTHER']).toBe('ONE');
        expect(process.env.KEY).toBe('VALUE');
        expect(process.env.ANOTHER).toBe('ONE');
    });

    test('should handle missing credentials', async () => {
        mockSecretManagerServiceClient = class {
            async accessSecretVersion() {
                const error: any = new Error('Could not load the default credentials');
                error.code = 16;
                throw error;
            }
        };

        await loadGcpSecrets('test-project', 'test-secret', {
            deps: {
                SecretManagerServiceClient: mockSecretManagerServiceClient,
                log: mockLog,
                error: mockError,
                exit: mockExit
            }
        });

        expect(errors.some(e => e.includes('Google Cloud Credentials not found'))).toBe(true);
        expect(exitCode).toBe(1);
    });

    test('should throw other errors', async () => {
        mockSecretManagerServiceClient = class {
            async accessSecretVersion() {
                throw new Error('Permission Denied');
            }
        };

        await expect(loadGcpSecrets('test-project', 'test-secret', {
            deps: {
                SecretManagerServiceClient: mockSecretManagerServiceClient,
                log: mockLog,
                error: mockError,
                exit: mockExit
            }
        })).rejects.toThrow('Permission Denied');
    });
});

import { test as base } from '@playwright/test';
import { addCoverageReport } from 'monocart-reporter';
import v8 from 'v8';

export const test = base.extend<{ autoCollectCoverage: void }>({
    autoCollectCoverage: [async ({ }, use, testInfo) => {
        await use();

        try {
            // @ts-ignore - takeCoverage exists in newer Node versions
            const coverage = (v8 as any).takeCoverage();

            if (coverage) {
                // Filter for our scripts
                const filtered = coverage.filter((entry: any) =>
                    entry.url.includes('/scripts/') &&
                    !entry.url.includes('node_modules') &&
                    !entry.url.includes('test/')
                );

                if (filtered.length > 0) {
                    console.log('Found coverage entries:', filtered.length);
                    console.log('Sample URL:', filtered[0].url);
                    await addCoverageReport(filtered, testInfo);
                } else {
                    console.log('No coverage entries found for scripts/');
                }
            }
        } catch (e) {
            console.warn('Failed to collect Node.js coverage:', e);
        }
    }, { auto: true, scope: 'test' }]
});

export const expect = base.expect;

import { SecretManagerServiceClient } from '@google-cloud/secret-manager';
import dotenv from 'dotenv';

interface SecretManagerError extends Error {
  code?: number;
}

export interface LoadGcpSecretsOptions {
  deps?: {
    SecretManagerServiceClient?: typeof SecretManagerServiceClient;
    log?: typeof console.log;
    error?: typeof console.error;
    exit?: typeof process.exit;
  }
}

export async function loadGcpSecrets(projectId?: string, secretName?: string, options: LoadGcpSecretsOptions = {}): Promise<dotenv.DotenvParseOutput | undefined> {
  const { deps = {} } = options;
  const Client = deps.SecretManagerServiceClient || SecretManagerServiceClient;
  const log = deps.log || console.log;
  const errorLog = deps.error || console.error;
  const exit = deps.exit || process.exit;

  const client = new Client();

  const finalProjectId = projectId || process.env.GOOGLE_CLOUD_PROJECT || 'url-redirector-479005';
  const finalSecretName = secretName || process.env.GCP_SECRET_NAME || 'url-redirector-dotenv';
  const name = `projects/${finalProjectId}/secrets/${finalSecretName}/versions/latest`;

  try {
    const [version] = await client.accessSecretVersion({ name });
    const secretPayload = version.payload?.data?.toString();

    if (!secretPayload) {
      throw new Error('Secret payload is empty');
    }

    const envConfig = dotenv.parse(secretPayload);
    for (const k in envConfig) {
      process.env[k] = envConfig[k];
    }
    return envConfig;

  } catch (error: unknown) {
    const err = error as SecretManagerError;
    // --- ADC GUARD CLAUSE ---
    // Check for common credential errors (Missing ADC, invalid paths, or gRPC Unauthenticated)
    if (
      err.message.includes('Could not load the default credentials') ||
      err.message.includes('no credentials found') ||
      err.code === 16 // gRPC status for UNAUTHENTICATED
    ) {
      errorLog('\n\x1b[31m%s\x1b[0m', 'ERROR: Google Cloud Credentials not found or invalid.'); // Red text
      errorLog('The script cannot access Secret Manager without authentication.');
      errorLog('\nPlease run the following command to log in:');
      errorLog('\x1b[36m%s\x1b[0m', '  gcloud auth application-default login'); // Cyan text
      errorLog('\nOr set GOOGLE_APPLICATION_CREDENTIALS to your key file path.\n');
      exit(1); // Exit gracefully
      return;
    }

    // If it's a different error (e.g., Secret doesn't exist, Permission Denied), rethrow it
    throw error;
  }
}
